/*
 *	メパチ パターン
 */
static void End_Title_Actor_draw(Actor *thisx, Game *game)
{
    End_Title_Actor *this = ( End_Title_Actor *)thisx;
    Game_play *game_play = (Game_play *)game;
    int frame = game_play->demo_play.flamecnt;
    Player_actor	*player =
	(Player_actor *)get_player_actor(game_play);
    
    /* 手の甲にトライフォース 出現 */
    OPEN_DISP(game->graph);
    _texture_z_light_fog_prim_xlu(game->graph);
    Matrix_mult(&(player->sword_matrix),SET_MTX);
    
    Matrix_translate(0.0F,150.0F,170.0F,MULT_MTX);
    Matrix_scale(0.13F,0.13F,0.13F,MULT_MTX);
    Matrix_rotateX(3000.0F *  (F_PI/32768.0f),MULT_MTX);
    Matrix_rotateY(0.0F *  (F_PI/32768.0f),MULT_MTX);
    Matrix_rotateZ(0.0F *  (F_PI/32768.0f),MULT_MTX);
    gSPMatrix(NEXT_POLY_XLU_DISP, Matrix_to_Mtx_new(game->graph),
	      G_MTX_MODELVIEW | G_MTX_LOAD | G_MTX_NOPUSH);
    
    gSPDisplayList(NEXT_POLY_XLU_DISP, end_triforce_modelT0);
    
    CLOSE_DISP(game->graph);

    OPEN_DISP(game->graph);
    
#if defined(PAL_VERSION)
    if(frame > 740) {
	if(this->alpha[0] < 200) this->alpha[0] += 8;
    }
    if(frame > 675) {
	if(this->alpha[1] < 200) this->alpha[1] += 18;
    }
    if(frame > 710) {
	if(this->alpha[2] < 200) this->alpha[2] += 18;
    }
#else
    if(frame > 890) {
	if(this->alpha[0] < 200) this->alpha[0] += 7;
    }
    if(frame > 810) {
	if(this->alpha[1] < 200) this->alpha[1] += 15;
    }
    if(frame > 850) {
	if(this->alpha[2] < 200) this->alpha[2] += 15;
    }
#endif
    /* NEXT_OVERLAY_DISP */
    SET_NOW_OVERLAY_DISP(gfx_xlu_rectangle_2c(NOW_OVERLAY_DISP));
    gDPSetTextureLUT(NEXT_OVERLAY_DISP,G_TT_NONE);
    gDPSetEnvColor(NEXT_OVERLAY_DISP,
		   255,120,30,0);
    gDPSetRenderMode(NEXT_OVERLAY_DISP,G_RM_PASS, G_RM_XLU_SURF2);
    gSPClearGeometryMode(NEXT_OVERLAY_DISP,
			 G_LIGHTING | G_CULL_BACK | G_TEXTURE_GEN |
			 G_TEXTURE_GEN_LINEAR | G_FOG);
    gDPSetCombineLERP(
	NEXT_OVERLAY_DISP,
	PRIMITIVE, ENVIRONMENT, TEXEL0, ENVIRONMENT,
	TEXEL0,0,PRIMITIVE,0,
	0,0,0,COMBINED,
	0,0,0,COMBINED
	);
    gDPSetPrimColor(NEXT_OVERLAY_DISP, 0, 128,
		    0,0,0,this->alpha[0]);
    gDPLoadTextureTile(
	NEXT_OVERLAY_DISP,
	h_end_theend_txt,
	G_IM_FMT_IA, G_IM_SIZ_8b,
	80, 24,
	0, 0, 80,24,
	NULL,
	G_TX_WRAP, G_TX_WRAP,0,0,0,0);
    gSPTextureRectangle(
	NEXT_OVERLAY_DISP,
	120 << 2, (90) << 2,
	200 << 2, (90 + 23) << 2,
	G_TX_RENDERTILE,
	0, 0,
	1 <<10, 1 << 10 );
    
    gDPPipeSync(NEXT_OVERLAY_DISP);    
    gDPSetPrimColor(NEXT_OVERLAY_DISP, 0, 128,
		    0,0,0,this->alpha[1]);
    gDPLoadTextureTile(
	NEXT_OVERLAY_DISP,
	h_end_title1_txt,
	G_IM_FMT_IA, G_IM_SIZ_8b,
	120, 24,
	0, 0,
	120,24,
	NULL,
	G_TX_WRAP, G_TX_WRAP,0,0,0,0);
    gSPTextureRectangle(
	NEXT_OVERLAY_DISP,
	100 << 2, (160) << 2,
	220 << 2, (160 + 23) << 2,
	G_TX_RENDERTILE,
	0, 0,
	1 <<10, 1 << 10 );

    gDPPipeSync(NEXT_OVERLAY_DISP);    
    gDPSetPrimColor(NEXT_OVERLAY_DISP, 0, 128,
		    0,0,0,this->alpha[2]);
    gDPLoadTextureTile(
	NEXT_OVERLAY_DISP,
	h_end_title2_txt,
	G_IM_FMT_IA, G_IM_SIZ_8b,
	112, 16,
	0, 0, 112,16,
	NULL,
	G_TX_WRAP, G_TX_WRAP,0,0,0,0);
    gSPTextureRectangle(
	NEXT_OVERLAY_DISP,
	104 << 2, (177) << 2,
	216 << 2, (177 + 15) << 2,
	G_TX_RENDERTILE,
	0, 0,
	1 <<10, 1 << 10 );
    
    CLOSE_DISP(game->graph);

}

